import React from 'react';


import '../node_modules/@material-ui/core/umd/material-ui.development.js';
import '../node_modules/@material-ui/core/umd/material-ui.production.min.js';

import './App.css';
import Show from './components/show';
import {AppBar, Toolbar, Button, Box, Icon} from '@material-ui/core';
import {Typography} from '@material-ui/core';

const App = props => {
    return (
        <div className="App">
            <AppBar position="static">
                <Toolbar>
                    <Box display='flex' felxDirection='row'
                        style={
                            {width: '100%'}
                        }
                        justifyContent='space-around'
                        alignItems="center">
                        <Typography color='inherit' variant='h6'>
                            ToDo app
                        </Typography>
                        <Icon color="secondary">
                              add
                            </Icon>
                    </Box>
                </Toolbar>
            </AppBar>
            <Show store={
                props.store
            }/>
        </div>
    );
}

export default App;
